import React, { Component } from 'react';
import '../App.css';

export default class Collection extends Component {
    constructor(props) {
        super(props);
        this.state = {
            url: this.props.imgUrl
        }
    }
    render() {
        const {url} = this.state;
        return(
            <div className="Collection">
            </div>
        )
    }
}
